Use dried lavender and honey to make a super simple syrup, which can be used for anything from coffee to drinks to cakes!

To make the syrup, bring 1 cup of water to a boil with 1 tbsp dried lavender. Once it’s simmering, add in a half cup of sugar and honey each. Simmer for 5 min, then let cool to room temperature. Strain out lavender bits and store in the fridge.

To make the latte, add 2-3 spoons of the syrup to coffee, top with frothed almond milk.

